class Solution {
    fun numberOfPowerfulInt(start: Long, finish: Long, limit: Int, s: String): Long {
        val len = s.length
        var count = 0L
        var minValue = s.toLong()
        if (minValue < start) minValue = start
        if (minValue > finish) return 0

        for (prefix in 0..limit) {
            val current = "$prefix$s".toLong()
            if (current in start..finish) count++
        }

        var prefix = 1
        while (true) {
            var isValid = true
            val current = StringBuilder()
            var temp = prefix
            while (temp > 0) {
                val digit = temp % 10
                if (digit > limit) {
                    isValid = false
                    break
                }
                current.append(digit)
                temp /= 10
            }
            if (!isValid) {
                if (current.isEmpty() || current.toString().toLong() > finish.toString().substring(0, len).toLong()) break
                prefix++
                continue
            }
            current.reverse()
            val num = (current.toString() + s).toLong()
            if (num in start..finish) count++
            else if (num > finish) break
            prefix++
        }

        return count
    }
}
